import React from "react";
import { Routes, Route } from "react-router-dom";
import {Main, Button, Heading, InsetText, Details,ListItem,UnorderedList
} from "govuk-react";


function Patient(){
return(
    <div>
        <Main>
            <Heading>Hello (Prop name here).</Heading>
            <InsetText>Navigate to your GP services or Profile from this page</InsetText>
            <Details summary="What can I do with GP Services?"></Details>
            <Details summary="What can I do with my Profile?"></Details>

        </Main>
    </div>
);
}

export default Patient;
